import React, {Component} from 'react';
import orangeMoney from "../../images/orange-money.png";
import './addFormation.css';
import '../add-former/addFormer';
import { connect } from 'react-redux';
import { addFormation } from "../../redux/formations/dispatch";
import { sendToast } from "../../redux/toast/dispatch";
import moment from "moment";
import 'moment/locale/fr';
import { AddFormer } from "../add-former/addFormer";
import { AddModule } from "../add-module/addModule";
import formation from "../../components/formation/formation";

const defaultFormation = {
    name: "",
    date: "",
    image: "data:image/jpeg;base64,",
    theme: "",
    place: "",
    goals: "",
    description: "",
    target: "",
    deadline: "",
    logo: "data:image/jpeg;base64,",
    price: "",
    transfert: "",
    phone: "",
    email: "",
    formers: [
        {
            firstname: "",
            lastname: "",
            job: "",
            email: "",
            phone: "",
        }
    ],
    modules: [
        {
            name: "",
            startTime: "",
            endTime: "",
            description: "",
        }
    ]
}

class AddFormation extends Component {

    constructor(props) {
        super(props);
        this.state = {
            formation: {...JSON.parse(JSON.stringify(defaultFormation))},
/*
            former: defaultFormer,
*/
        }
    }

    changeInput = (e) => {
        let formation = this.state.formation;
        formation[e.currentTarget.name] = e.currentTarget.value;
        this.setState({formation: formation});
        console.log("formation_set_state", this.state.formation);
    };

    changeInputAddFormer = (e, index) => {
        let formers =  this.state.formation.formers;
        if (formers[index]) {
            formers[index] = e;
            this.setState({...this.state, formation: {...this.state.formation, formers: formers}});
        }
    }

    changeInputAddModule = (e, index) => {
        let modules = this.state.formation.modules;
        if (modules[index]) {
           modules[index] = e;
           this.setState({...this.state, formation: {...this.state.formation, modules: modules}});
        }
        console.log(e);
    }

    getImage = (e) => {
        const files = e.currentTarget.files;
        const reader = new FileReader();
        let {formation} = this.state;

        reader.onload = (e) => {
            formation.image = e.target.result;
            this.setState({formation})
        };
        reader.readAsDataURL(files[0]);
    };

    checkDate = (formation) => {
        const today = moment(Date.now()).format('YYYY-MM-DD');

        if(formation.deadline.trim() !== "" && formation.date > formation.deadline) {
            console.log("attention");
            return "La date de la formation doit être inférieure à la date limite d'inscription";
        }
        return null;
    };

    checkForm() {
        const {formation} = this.state;
        const {dispatch} = this.props;
        const error = this.checkDate(formation);

        if(error) {
            dispatch(
                sendToast(
                    "error",
                    error));
        } else {
            this.addFormation();
        }
    }

    addFormation = () => {
        console.log("ajouterrr");
        const {dispatch} = this.props;
        const {formation} = this.state;
        dispatch(addFormation(formation))
            .then(() => {
                this.setState({formation: {...JSON.parse(JSON.stringify(defaultFormation))}});
                //this.setState({formation: {...JSON.parse(JSON.stringify(defaultFormation))}});
            })
            .catch(error => {
                console.log("error", error.message);
            })
        console.log('defaultFormation', defaultFormation);
    }

    addFormerButton = () => {
        console.log('ajout former');
        const formers = this.state.formation.formers;
        formers.push(defaultFormer);
        this.setState({...this.state, formation: {...this.state.formation, formers: formers}});
    }

    handleSubmit(e) {
        e.preventDefault();
       // e.target.reset();
        this.checkForm();
       // this.setState({formation: defaultFormation});

    };

    render() {
        const {formation} = this.state;
        const {modules} = formation.modules;
        console.log('formation', formation);

        return (
            <div className="formation-container">

                <form onSubmit={this.handleSubmit.bind(this)}>
                    <div className="add-formation">

                        <div className="div-info-formation">
                            <label htmlFor="name">Nom de la formation: </label>
                            <input
                                id="name"
                                className="input-name"
                                name="name"
                                type="text"
                                value={formation.name}
                                onChange={this.changeInput}
                            />
                        </div>

                        <div className="div-info-date">

                            <div className="div-info-formation">
                                <label htmlFor="date">Date de la formation:
                                </label>
                                <input
                                    id="date"
                                    className="input-date"
                                    name="date"
                                    type="date"
                                    value={formation.date}
                                    onChange={this.changeInput}
                                />
                            </div>

                            <div className="div-info-formation">
                                <label htmlFor="deadline">Date limite:</label>
                                <input
                                    id="deadline"
                                    className="input-date"
                                    name="deadline"
                                    type="date"
                                    value={formation.deadline}
                                    onChange={this.changeInput}
                                />
                            </div>

                        </div>

                        <div className="div-info-formation image">
                            {/*<label>*/}
                                <img
                                    className="add-formation-image"
                                    src={formation.image}
                                />
                                <input
                                    className="add-formation-image"
                                    type="file"
                                    onChange={this.getImage}
                                    accept="image/*"
                                />
                            {/*</label>*/}
                        </div>

                        <div className="add-formation-theme">
                            <label htmlFor="theme">Thème: </label>
                            <input
                                id="theme"
                                className="input-theme"
                                name="theme"
                                type="text"
                                value={formation.theme}
                                onChange={this.changeInput}
                            />
                        </div>

                        <div className="add-formation-target">
                            <label htmlFor="target">Public cible: </label>
                            <input
                                id="target"
                                className="input-target"
                                name="target"
                                type="text"
                                value={formation.target}
                                onChange={this.changeInput}
                            />
                        </div>

                        <div className="add-formation-place">
                            <label htmlFor="place">Lieu de la formation: </label>
                            <input
                                id="place"
                                name="place"
                                className="input-place"
                                type="text"
                                value={formation.place}
                                onChange={this.changeInput}
                            />
                        </div>

                        <div className="add-formation-description">
                            <label htmlFor="description">Description: </label>
                            <textarea
                                id="description"
                                name="description"
                                className="input-description"
                                value={formation.description}
                                onChange={this.changeInput}>
                            </textarea>
                        </div>

                        <div className="add-formation-description">
                            <label htmlFor="goal">Objectif: </label>
                            <textarea
                                id="goals"
                                name="goals"
                                className="input-description"
                                value={formation.goals}
                                onChange={this.changeInput}>
                            </textarea>
                        </div>

                        {/*
                        <AddFormer
                            formation = { formation }
                            former = {formers[0]}
                            changeInputAddFormer = {this.changeInputAddFormer}
                        />
                        */}
                         {
                             formation.formers && formation.formers.map((former, index) => {
                                return (
                                    <AddFormer
                                        key={`former${index}`}
                                        former = {former}
                                        index={index}
                                        changeInputAddFormer = {this.changeInputAddFormer}
                                    />
                                )
                            })
                        }

                        <div className="add-formation-button">
                            <button type="button" className="btn btn-valider" onClick={this.addFormerButton}>
                                +
                            </button>
                        </div>

                        {
                            formation.modules && formation.modules.map((module, index) => {
                                return (
                                    <AddModule
                                        key={`formers${index}`}
                                        module = { module }
                                        index = { index }
                                        changeInputAddModule = {this.changeInputAddModule}
                                    />
                                )
                            })
                        }

                        <div className="add-formation-footer">

                            <div className="add-formation-price">
                                <label htmlFor="price">Coût de la formation:</label>
                                <input
                                    id="price"
                                    className="add-formation-price"
                                    name="price"
                                    type="number"
                                    value={formation.price}
                                    onChange={this.changeInput}
                                    min="0"
                                />
                            </div>

                            <div className="add-formation-phone">
                                <label htmlFor="transfert">Contacts:</label>
                                <input
                                    id="transfert"
                                    className="add-formation-phone"
                                    name="transfert"
                                    type="tel"
                                    pattern="[0-9]{2}[0-9]{2}[0-9]{2}[0-9]{2}"
                                    value={formation.transfert}
                                    onChange={this.changeInput}
                                />
                            </div>

                            <div className="add-formation-email">
                                <label htmlFor="email">Email:</label>
                                <input
                                    id="phone"
                                    className="add-formation-email"
                                    name="email"
                                    type="email"
                                    value={formation.email}
                                    onChange={this.changeInput}
                                />
                            </div>

                        </div>

                        <div className="add-formation-button">
                            <button type="submit" className="btn btn-valider">
                                Valider
                            </button>
                        </div>

                    </div>
                </form>
            </div>
        )
    }
}

const mapStateToProps = (state) => {
    return {
    formations: state.formationsReducer.formations
    }
}
export default connect(mapStateToProps)(AddFormation);
